import React from 'react';
import styled from "styled-components" 


const StyledCard = styled.div `
    position: relative
`
const StyledImage = styled.div ` 
    position: absolute;
    width: 400px;
    height: 400px;
    border-radius:8px
`

const StyledImg = styled.img `
    width: 100%;
    height: 100%;
    border-radius: inherit;
`

const StyledContent = styled.div `
    background-color: white;
    width: 360px;
    height: 125px;
    border-radius: 20px
`

const Card = () => {
    return (
        <StyledCard>
            <StyledImage>
                <StyledImg src="https://cdn.dribbble.com/userupload/11087035/file/original-d18e5383bf37c6baaf074a8b3c5b5447.png?resize=1200x900" alt="#" />
            </StyledImage>
            <div>
                <div>
                    <img src="https://cdn.dribbble.com/userupload/11087035/file/original-d18e5383bf37c6baaf074a8b3c5b5447.png?resize=1200x900" alt="#" />
                    <span>@zndrson</span>
                    <span>256</span>
                </div>
                <div>
                    <h3>Cosmic Perspective</h3>
                    <span>12,000 PSL</span>
                </div>
            </div>
        </StyledCard>
    );
};

export default Card;
